        Hadoop MapReduceのジョブは各スレーブノード上で1タスクごとにJVMが1プロセス起動する形で実行される。
で、それらのアプリケーションのプロファイルをとりたい場合、各々のJVMごとにとることになる。これにはhprofを使う。Apache Hadoop 2.7.0 – MapReduce Tutorialこの記述に従って以下のプロパティをセットする。ジョブ起動時に指定すれば有効にできる。プロファイラのパラメータはデフォルトがあるという話だったけど、やってみたら指定しないとエラーになった。以下の指定は自分が試したとき用にいじってある。
mapreduce.task.profile=true
mapreduce.task.profile.params=-agentlib:hprof=depth=4,interval=100,cutoff=0.001,cpu=samples,heap=sites,force=n,thread=n,verbose=n,file=%s

# MRv1の場合は mapred.task.profile などとするプロファイラのオプション指定についてはOracle Java SE doucumentを見ればいいのかなと思うけど、なんかいまいち詳しくない。自分が設定する分にはIBMのサイトの日本語解説が役にたった。IBMのやつとOracleので違いがあるかもしれないけど、特に気付かなかった。HPROF: A Heap/CPU Profiling Tool
IBM Knowledge Center HPROF プロファイラーの使用このオプションを有効にしてジョブを実行すると、ジョブ終了時(正確にはプロファイラを有効にしたtaskの終了時)に profile.out が生成され、そこにプロファイル結果が出力される。これはJobHistoryServerもしくはJobTrackerのWeb UIから該当のattempt(もしくはtask)を選んで*1、そのログを見れば見られる。いちいちHDFSやローカルファイルシステムに見にいかなくてもいいのは便利。


    YARN MRv2での問題
    MRv1ならこれだけで一発で結果が得られるんだけど、YARN + MRv2で実行しているとこの結果がちゃんと出てこない。起動時のバナーだけ見られたり、あるいはプロファイル結果の出力が途中でブチ切れた状態になっていたりする。
これはhprofの結果出力がJVMがTERMシグナルを受け取って働く終了処理の中で行われるからだ。んでYARNはTERMを送ったら250msだけ待って終了していないとすぐKILLを送る。ので、プロファイラの結果出力の最中でJVMがKILLられて結果出力がちゃんと得られない、ということになる。この問題についてはApache JIRAにissueがある。Resolvedになっているが該当バージョンは 2.8.0 だ![MAPREDUCE-5465] Tasks are often killed before they exit on their own - ASF JIRA2.8.0 を待っているわけにはいかないので、どうにか設定をいじってattemptのコンテナがKILLられてしまうまで猶予を作ってみる。これは各スレーブノードで設定して NodeManager を再起動する。
  &lt;property&gt;
    &lt;name&gt;yarn.nodemanager.process-kill-wait.ms&lt;/name&gt;
    &lt;value&gt;30000&lt;/value&gt;
  &lt;/property&gt;

  &lt;property&gt;
    &lt;name&gt;yarn.nodemanager.sleep-delay-before-sigkill.ms&lt;/name&gt;
    &lt;value&gt;30000&lt;/value&gt;
  &lt;/property&gt;
ジョブのConfigurationを見てもこの変更が反映されていなくてアレっと思ったが、試してみた限りでは想定通りに動いているようだ。ちゃんとプロファイル結果が最後まで出力されるようになった。
何か副作用があるかどうかというと、もしかして特定の条件で30秒間だけ長く生き残ってしまうattempt containerが出てしまうかもしれないけど……まあ、特に問題でもないでしょう。めでたしめでたし。



    まとめ
    Enjoy profiling!


*1:プロファイラが有効になっているものは明らかに実行時間が長くなるからすぐにわかる



　リサジュー図形作ってみた。

スライダーを動かすとパラメータが変わって図形が変化する。・スライダーの使い方がぼやっとわかった
　ヒエラルキー→Create→UI→Slider。
Canvasとスライダー、EventSystemが作られる。
値を取得する例：
スライダーを作る、Main CameraにCamera.csを付ける。
Camera.csの中にpublic void hoge(float value)を作る。
スライダーのインスペクタの下、On Value Changed(Single)の+をクリック。
Main Cameraを設定、関数はCameraの中のhogeを選択。
後はスライダーの値が変わればhogeが呼ばれる。
Main.cs
using UnityEngine;
using System.Collections;

public class Main : MonoBehaviour {
    public GameObject go;

    int sizePosition = 3601;
    GameObject li;
    float dpi;
    float dpih;
    LineRenderer lr;

    //スライダー関係
    float v1 = 1;
    float v2 = 1;
    float v3 = 1;
    float v4 = 0.5f;

	// Use this for initialization
	void Start () {
        li = Instantiate(go);
        lr = li.GetComponent&lt;LineRenderer&gt;();

        lr.enabled = true;
        lr.SetVertexCount(sizePosition);

        dpi = Mathf.PI / 180.0f;

        poss();
	}

	// Update is called once per frame
	void Update () {

        poss();
	}

    void poss()
    {
        for (int i = 0; i &lt; sizePosition; i++)
        {
            float px = 50*v3 * Mathf.Sin(i * v1 * dpi);// *Mathf.Cos(i * v1 * dpi);
            float pz = 50*v3 * Mathf.Cos(i*v2 * dpi);// *Mathf.Sin(i * v2 * dpi);
            float py = 100*v4;// 0.01f * i;
            lr.SetPosition(i, new Vector3(px, py, pz));
        }
    }

    public void getSlider1Value(float v)
    {
        v1 = v;
    }

    public void getSlider2Value(float v)
    {
        v2 = v;
    }

    public void getSlider3Value(float v)
    {
        v3 = v;
    }

    public void getSlider4Value(float v)
    {
        v4 = v;
    }
}
